        console.log(products)

        return (
            <div>
<Carousel/>
<Card style={{ width: "18rem" }}>
         {console.log(product[0].id)}

        <a href = {`/proudectdetails/${products.id}`} ><Card.Img variant="top" src= {products.img} /></a>
